import React, { useEffect, useState } from "react";
import axios from "axios";

const AllCustomer = () => {
  const [customers, setCustomers] = useState([]);
  const [error, setError] = useState("");

  useEffect(() => {
    const fetchCustomers = async () => {
      try {
        const response = await axios.get("http://localhost:8000/api/customers");
        setCustomers(response.data.customers);
      } catch (err) {
        setError("Failed to fetch customers.");
      }
    };

    fetchCustomers();
  }, []);





  // Data Delete


    const handleCustomerDelete = async (customerId) => {
      if (!window.confirm("Are you sure you want to delete this category?"))
        return;

      try {
        const response = await axios.delete(
          `http://localhost:8000/api/customer/${customerId}`
        );

        if (response.status !== 200) {
          throw new Error(response.data.message || "Failed to delete customer");
        }

        alert(response.data.message);

        // Refresh category list after deletion
        setCustomers(
          customers.filter((customer) => customer.customer_id !== customerId)
        );
      } catch (error) {
        alert("Error: " + error.message);
      }
    };


  return (
    <div className="page-content">
      <div className="page-breadcrumb d-none d-sm-flex align-items-center mb-3">
        <div className="breadcrumb-title pe-3">Tables</div>
        <div className="ps-3">
          <nav aria-label="breadcrumb">
            <ol className="breadcrumb mb-0 p-0">
              <li className="breadcrumb-item">
                <a href="#">
                  <i className="bx bx-home-alt"></i>
                </a>
              </li>
              <li className="breadcrumb-item active" aria-current="page">
                Data Table
              </li>
            </ol>
          </nav>
        </div>
      </div>
      <h6 className="mb-0 text-uppercase">Customer List</h6>
      <hr />
      <div className="card">
        <div className="card-body">
          {error && <div className="alert alert-danger">{error}</div>}
          <table className="table mb-0 table-hover">
            <thead>
              <tr>
                <th scope="col">No</th>
                <th scope="col">Name</th>
                <th scope="col">Email</th>
                <th scope="col">Phone</th>
                <th scope="col">Address</th>
                <th scope="col">Action</th>
              </tr>
            </thead>
            <tbody>
              {customers.map((customer, index) => (
                <tr key={customer.customer_id}>
                  <th scope="row">{index + 1}</th>
                  <td>{customer.name}</td>
                  <td>{customer.email}</td>
                  <td>{customer.phone}</td>
                  <td>{customer.address}</td>
                  <td>
                    <button className="btn btn-primary btn-sm">Edit</button>
                    <button
                      className="btn btn-danger btn-sm"
                      onClick={() => handleCustomerDelete(customer.customer_id)}
        
                    >    Delete 
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default AllCustomer;
